import pygame
class Platforma(pygame.sprite.Sprite):
    def __init__(self):
        super().__init__()
        self.obraz=pygame.image.load("images/pad.png")
        self.reset_pozycji()

    def reset_pozycji(self):
        self.rect=pygame.Rect(1024/2-70,800-100,140,30)
    def przesun(self,kierunek):
        #kierunek -1 będzie dla lewej strony, kierunek 1 
        #dla prawej
        predkosc=10
        self.rect.move_ip(kierunek*predkosc,0)
        if self.rect.left<=0: 
            self.rect.x=0
        if self.rect.right>=1024: 
            self.rect.x=1024-140
